export function Cart(propss) {

    <div className="col-md-6">
    <h3>Cart {total}</h3>
    <table className="table table-dark table-bordered">
      <thead>
        <tr>
          <th>Title</th>
          <th>Category</th>
          <th>Price</th>
          <th>Count</th>
          <th>Subtotal</th>
          <th>Actions</th>
        </tr>
      </thead>
      <tbody>
        {
          propss.map(elm => {
            return <tr key={elm.id}>
              <td>{elm.title}</td>
              <td>{elm.category}</td>
              <td>{elm.price}</td>
              <td>{elm.count}</td>
              <td>{elm.count * elm.price}   </td>
                <td>
              <td><button onClick={() => countUp(elm)}>countUP</button>   </td>
              <td><button onClick={() => countDown(elm)}>countDown</button>   </td>
              <td><button onClick={() => countDelate(elm)}>countDelate </button>   </td>
              </td>
            </tr>
          })
        }
      </tbody>
    </table>
  </div>

}



